import React from 'react';
import styled from "styled-components";


const Projects = () => {
  return (
    <Container id="projects">
      <Wrapper>
        <Title>Skills</Title>
        <Desc>
          Here are some of skills on which I have been working on for the past 2 years.
        </Desc>
      </Wrapper>
    </Container>
  )
}

export default Projects;
